INSERT INTO `review` VALUES (1,3,'First day of class: \'You are taking this class to learn, not to get an A. 30% of you will get a C or lower.\' I freak out. I consider dropping. I stick it out. He is a fantastic lecturer. Extremely clear. PP are very helpful. He tells you that you need to have done the reading and prepare for class because he\'s gonna cold call you, but realistically, it\'s a class of 50 students so you\'ll be fine.\nWeekly psets: They will take 3-4 hours, you can do them w a buddy, and they are graded for completion.\nMidterm: Very similar to practice test he gives (and reviews in class). If you know your stuff an A is attainable\nFinal: Harder. But if you study, it is manageable (and he gives you an option to give more weight to the test that you did better on).\nAll in all: If you want to learn Financial Accounting, there is no better teacher.',NULL,'Weekly Psets, Midterm, Final',4,'2020-06-21 04:55:38'),(2,20,'Lydia is honestly such an amazing person. Her personality really shows through her lectures--you\'ll learn about all her favorite things: Star Trek, The Office, DDR, The Knicks, what the world\'s best boarding pass looks like. Her lectures are not heavy and very easy to pay attention to since she\'s so great at talking and is just so excited! She also does a good job of guiding people through the design process, focusing your attention on the little details and potential areas of frustration. Her slides have everything you need for the material, and I often find that it\'s enough to just pay attention. She also ends class early frequently and gives a nice summary after every lecture.\n\nFrom someone with no webdev background, it would\'ve been nice if she taught some basic technical stuff i.e. JS, HTML, CSS. To be fair, webdev is hard to learn without trying it yourself, and the functions you need are often specific to what you want to implement. Our first programming hw was a static replica of the Gmail interface, which killed me as a newbie. Her written HWs are a bit subjective since she seems to have an answer in her head that she\'s looking for, and it\'s not always clear as to how much of an explanation is enough. The final project for this class is spread across 6 weeks, and she provides \'milestones\' along the way to keep you on track. She also emphasizes the importance of early feedback in the design process and allots class time for feedback exchange between peers. Overall, if you have some kind of front end experience, this class should be chill.\n\nThere is a \'participation\' component of the grade that is annoying for many, because your name has to be recorded by a TA hidden in the back of the room. Lydia likes to engage the class with short answer questions, and will call on people to speak. Your participation grade is almost entirely dependent on how well she can remember your name, and how hard the TAs try to figure out who spoke. Apparently the TAs came up with a scheme to remember where each of the three asian Kevins sat. It\'s often unfortunate for me to be one of the many shoulder length haired asian girls in the class, and it\'s a small victory on my part on those rare occasions when she gets my name. She definitely needs a better system to track participation, but if she doesn\'t establish one, I\'d advise you to dye your hair purple before taking her class.',NULL,'2 Written HWs (10%), 2 Programming HWs (20%), Participation (15%), Website Project (35%), Final (20%)',3,'2018-04-15 02:43:37'),(3,20,'The second half of the course should be called Functional User Interfaces.','204.194.187.15','Weekly assignments. Not astoundingly difficult, but the assignments become very tedious and time consuming if you haven\'t used JavaScript before.',3,'2020-02-18 05:28:39'),(4,20,'One of the most interesting professors to teach. She\'s very enthusiastic and hyper. From previous comments here, I see she\'s changed her attendance policy a bit. We submitted a google form with what we said in class or if we did not speak by a certain time after class. For the first time, participation wasn\'t as difficult as I thought it would be. She purposefully asks a range of questions from super easy ones like, \'What do you click on amazon\'s webpage to buy a book?\' while the picture is on screen to more technical questions. She does this so people will be more engaged. I\'d say that classes are fun, but I agree, technical stuff isn\'t really taught in class. I\'m glad I decided to learn html, css, and a bit of javascript the winter break before, but as the projects became more complicated with flask and python, I struggled quite a bit.','71.56.229.36','Easy at first, harder later. Weekly homework and one mandatory participation per class.',3,'2020-05-01 05:05:11'),(5,167,'asdasd','127.0.0.1','asdasd',2,'2020-09-18 04:28:39'),(6,38,'asdasd','127.0.0.1','asdasd',2,'2020-09-18 04:29:44'),(7,1,'test','127.0.0.1','test',2,'2020-09-19 22:07:00'),(8,1,'test','127.0.0.1','test',2,'2020-09-19 22:08:49');
